export default class TemplateSelector extends Scrollbox {
  background: Sprite
  constructor() {
    super({
      overflowX: "none",
      boxHeight: 300,
      boxWidth: 500,
      passiveWheel: false,
      stopPropagation: true,
      divWheel: app.view,
    })
    this.background = this.content.addChild(new Sprite(Texture.WHITE))
    this.buildList()
    this.update()

    const closeButton = new Button({
      label: "Close",
      fontSize: 20,
    })
    closeButton.y = this.height + closeButton.height / 2
    closeButton.x = this.width / 2
    closeButton.interactive = true
    closeButton.buttonMode = true
    closeButton.on("pointerdown", (e) => {
      e.stopPropagation()
      this.destroy()
    })
    const footer = new Sprite(Texture.WHITE)
    footer.width = this.background.width
    footer.height = closeButton.height + 4
    footer.tint = 0xdddddd
    footer.y = this.height - 2

    const header = new Sprite(Texture.WHITE)
    header.width = this.background.width
    header.height = closeButton.height + 4
    header.tint = 0xdddddd
    header.y = -closeButton.height
    const templateText = new Text("Templates", { fontSize: 20 })
    templateText.x = this.width / 2
    templateText.y = -closeButton.height / 2
    templateText.anchor.set(0.5)
    this.addChild(header, templateText, footer, closeButton)
  }
  buildList() {
    let userTemplates: { label: string; hash: string; isUser: boolean }[] = []
    try {
      const userTemplateString = localStorage.getItem("userTemplates") || "{}"
      const parsedTemplates = JSON.parse(userTemplateString)
      userTemplates = Object.keys(parsedTemplates).map((key) => ({
        label: key,
        hash: parsedTemplates[key],
        isUser: true,
      }))
    } catch {
      userTemplates = []
    }
    const allTemplates = [...templates, ...userTemplates]
    this.background.height = Math.max(350, allTemplates.length * 30)
    this.background.width = 500
    this.filters = [new DropShadowFilter()]
    for (var a = 0; a < allTemplates.length; a++) {
      const template = allTemplates[a]
      const button = new Button({
        label: template.label,
        width: 100,
        height: 30,
        fontSize: 20,
      })
      button.x = this.width / 2
      button.y = 30 + 30 * a
      button.interactive = true
      button.buttonMode = true
      button.on("pointerdown", () => {
        if (template.hash) {
          grid.loadHash(template.hash)
          this.destroy()
        }
      })
      this.content.addChild(button)
      if (template.isUser) {
        const trashButton = new Button({
          label: "X",
          width: 30,
          height: 30,
          fontSize: 20,
        })
        trashButton.x = this.background.width - 30
        trashButton.y = button.y
        trashButton.interactive = true
        trashButton.buttonMode = true
        trashButton.on("pointerdown", () => {
          console.log("Hello!")
          try {
            const templatesStr = localStorage.getItem("userTemplates") || "{}"
            const parsed = JSON.parse(templatesStr)
            delete parsed[template.label]
            localStorage.setItem("userTemplates", JSON.stringify(parsed))
          } catch (e) {
            console.log(e)
          }
          this.destroy()
        })
        this.content.addChild(trashButton)
      }
    }
  }
}
